import React from "react";

const SearchBar = (props) => (
  <header>
    <img src="/images/logo.png" alt="logo" />
    <span>Youtube</span>
    <form>
      <input type="text" placeholder="Search..." />
      <button type="submit">
        <img src="/images/search.png" alt="search" />
      </button>
    </form>
  </header>
);

export default SearchBar;
